fun Entity.getHead(): MobHead {
    val head: EntityHead
    when(this.type){
        EntityType.CAT -> {
            val cat = this as Cat
            head = EntityHead.valueOf(cat.type.name.uppercase() + "__" + cat.catType.name.uppercase() + "__" + cat.collarColor.name.uppercase())
        }
        EntityType.ZOMBIE_VILLAGER -> {
            val zombieVillager = this as ZombieVillager
            head = EntityHead.valueOf(zombieVillager.type.name.uppercase() + "__" + zombieVillager.villagerProfession?.name?.uppercase())
        }
        EntityType.MUSHROOM_COW -> {
            val mushroomCow = this as MushroomCow
            head = EntityHead.valueOf(mushroomCow.type.name.uppercase() + "__" + mushroomCow.variant.name.uppercase())
        }
        EntityType.SHEEP -> {
            val sheep = this as Sheep
            head = EntityHead.valueOf(sheep.type.name.uppercase() + "__" + (sheep.color!!.name.uppercase()))
        }
        EntityType.WOLF -> {
            val wolf = this as Wolf
            head = EntityHead.valueOf(wolf.type.name.uppercase() + "__" + wolf.collarColor.name.uppercase())
        }
        EntityType.SNOWMAN -> {
            val snowman = this as Snowman
            head = EntityHead.valueOf(snowman.type.name.uppercase() + "__" + snowman.isDerp.toString())
        }
        EntityType.HORSE -> {
            val horse = this as Horse
            head = EntityHead.valueOf(horse.type.name.uppercase() + "__" + horse.color.name.uppercase())
        }
        EntityType.RABBIT -> {
            val rabbit = this as Rabbit
            head = EntityHead.valueOf(rabbit.type.name.uppercase() + "__" + rabbit.rabbitType.name.uppercase())
        }
        EntityType.LLAMA -> {
            val llama = this as Llama
            head = EntityHead.valueOf(llama.type.name.uppercase() + "__" + llama.color.name.uppercase())
        }
        EntityType.TRADER_LLAMA -> {
            val llama = this as TraderLlama
            head = EntityHead.valueOf(llama.type.name.uppercase() + "__" + llama.color.name.uppercase())
        }
        EntityType.PARROT -> {
            val parrot = this as Parrot
            head = EntityHead.valueOf(parrot.type.name.uppercase() + "__" + parrot.variant.name.uppercase())
        }
        EntityType.VILLAGER -> {
            val villager = this as Villager
            head = EntityHead.valueOf(villager.type.name.uppercase() + "__" + villager.profession.name.uppercase())
        }
        EntityType.PANDA -> {
            val panda = this as Panda
            head = EntityHead.valueOf(panda.type.name.uppercase() + "__" + panda.mainGene.name.uppercase())
        }
        EntityType.FOX -> {
            val fox = this as Fox
            head = EntityHead.valueOf(fox.type.name.uppercase() + "__" + fox.foxType.name.uppercase())
        }
        EntityType.AXOLOTL -> {
            val axolotl = this as Axolotl
            head = EntityHead.valueOf(axolotl.type.name.uppercase() + "__" + axolotl.variant.name.uppercase())
        }
        else -> {
            head = EntityHead.valueOf(this.type.name.uppercase().uppercase())
        }
    }
    return MobHead(head.isOnlyCreative, head.isOnlyNatural, createHead(head.base64), head)
}

private fun createHead(base64: String): ItemStack{
    return itemStack(Material.PLAYER_HEAD){
        val profile = GameProfile(UUID.randomUUID(), null)
        val encoded = Base64.getEncoder().encode(String.format("{textures:{SKIN:{url:\"%s\"}}}", base64).toByteArray())
        profile.properties.put("textures", Property("textures", String(encoded)))
        val field: Field
        val skullMeta = itemMeta as SkullMeta

        field = skullMeta.javaClass.getDeclaredField("profile")

        assert(field != null)
        field.isAccessible = true
        field.set(skullMeta, profile)
    }
}

